import React, { memo } from 'react';
import styled from 'styled-components';

const ItemBtn = styled.div`
    font-size: 14px;
    font-weight: 700;
    width: 80%;
    color: black;
    margin: auto;
    background-color: white;
    text-align: center;
    padding: 25px 17px;
    border-radius: 5px;
`;
const ItemButton = memo(() => {
    return (
        <ItemBtn>
            선택한 상품
        </ItemBtn>
    );
});

export default ItemButton;
